                    <h4>About Our Glass Shelves</h4>
                    <br>
                    <p>Glass shelves are a great way to add some high design to your space without breaking the bank. We have a full selection of custom glass shelves and in-stock glass and shelf kit options. Here are some things you should know about our glass shelves.</p>
