    <section id=""where-use"">
        <div class=""container"">
            <div class=""row"">
                <div class=""where-use-right col-8"">
                    <h4>Where to Use Custom Glass</h4>
                    <br>
                    <p>Our custom and pre-made glass shelves can be used in a variety of places around your home or business. They're just as sturdy as other types of shelves, and can hold a fair amount of weight. A wall-mounted glass shelf can add just the right amount of modern class for a light-enhancing, streamlined look. Here are s");
            WriteLiteral(@"ome places you can use glass shelves.</p>
                    <br>
                    <ul>
                        <li>
                            <p>Bathrooms - our custom shelves and shelf kits are safe to use in a humid environment like a bathroom, even in the shower!</p>
                        </li>
                        <li>
                            <p>Kitchens - use glass shelves to replace a broken cabinet shelf or to add attractive storage space.</p>
                        </li>
                        <li>
                            <p>Home Decor - use glass shelves in living rooms, bedrooms, closets, or dining rooms.</p>
                        </li>
                        <li>
                            <p>Offices - custom glass shelves can create a modern workspace, whether it is in your home or business.</p>
                        </li>
                        <li>
                            <p>Restaurants and Bars - Custom glass shelves are a great choice for your b");
            WriteLiteral(@"usiness, especially bars and restaurants. They're easy to keep clean and are durable enough for heavy use.</p>
                        </li>
                    </ul>
                </div>
