        <div class=""container"">
            <h3>How to Order Glass Shelves</h3>
            <br>
            <p>Make sure you get the right glass shelf for your space! We're here to help, if you have any questions. Here are the steps to ordering glass shelves:</p>
            <br>
            <ol>
                <li>
                    <p>Measure the area where you want to hang your shelves.</p>
                </li>
                <li>
                    <p>Use our <a");
